import React from 'react';
import { motion } from 'framer-motion';
import HeaderLinks from './HeaderLinks';
import Logo from './assets/mgilogo.png';
import { Link } from 'react-router-dom';

function Header() {
  return (
    <motion.nav
      initial={{ y: -250 }}
      animate={{ y: 0 }}
      transition={{ type: 'spring', stiffness: 120 }}
      className="navbar navbar-expand-lg navbar-light bg-light" // Change bg-light to another bg-* class for color
    >
      {/* Use d-flex justify-content-between to align items to sides */}
      <div className="container-fluid d-flex justify-content-between">
        {/* Logo and Title aligned to the left */}
        <Link to="/" className="navbar-brand d-flex align-items-center">
          <img src={Logo} alt="Logo" style={{ height: '50px', marginRight: 'w0px'}} />
          My Website
        </Link>
        {/* HeaderLinks (Menu) aligned to the right */}
        <HeaderLinks />
      </div>
    </motion.nav>
  );
}

export default Header;
